//import React from "react";
import CourseForm from "./components/CourseForm";
import CourseList from "./components/CourseList";

// src/App.jsx
import { useEffect, useState } from "react";
//import "./App.css";

function App() {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://13.51.11.25:8080/api/timetable/courses")
      .then((res) => res.json())
      .then((data) => {
        setCourses(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Failed to load courses", err);
        setLoading(false);
      });
  }, []);

  return (
    <div className="container">
      <h1>ðŸ“š Course List</h1>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {courses.map((course) => (
            <li key={course.id}>
              <strong>{course.name}</strong><br />
              Time Slot: {course.timeSlot?.day} - {course.timeSlot?.startTime} to {course.timeSlot?.endTime}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default App;
